    <script type="text/javascript">
        const BORDER_WT = 12;
        const BORDER_HT = 16.4;

        function crop_bottom_left_corner(ori_img, resize_ratio = 0.25) {
            // Get Height & Width
            const ht = ori_img.rows;
            const wt = ori_img.cols;

            // Calculate resized dimensions
            const resize_ht = Math.floor(ht * resize_ratio);
            const resize_wt = Math.floor(wt * resize_ratio);

            // Calculate offsets for cropping the bottom left corner
            const offset_ht = ht - resize_ht
            const offset_wt = 0

            // Crop Image By 25% (Bottom Left Corner)
            const crop_region = new cv.Rect(offset_wt, offset_ht, resize_wt, ht - offset_ht);
            const crop_img = ori_img.roi(crop_region);

            return { crop_img, offset_ht, offset_wt };
        }

        function cv_pipeline(mat) {

            // Crop Image
            let grayScale = new cv.Mat();
            let imgContrast = new cv.Mat();
            let imgThresh = new cv.Mat();

            // cv.GaussianBlur(mat, imgBlur, new cv.Size(9, 9), 0);
            cv.cvtColor(mat, grayScale, cv.COLOR_RGB2GRAY, 0);
            cv.convertScaleAbs(grayScale, imgContrast, 1.85, 80);
            cv.threshold(imgContrast, imgThresh, 0, 255, cv.THRESH_BINARY_INV + cv.THRESH_OTSU);

            let contours = new cv.MatVector();
            let hier = new cv.Mat();
            cv.findContours(imgThresh, contours, hier, cv.RETR_TREE, cv.CHAIN_APPROX_SIMPLE);

            cv.imshow('imgContrast', imgContrast);
            cv.imshow('imgThresh', imgThresh);

            grayScale.delete();
            imgContrast.delete();
            imgThresh.delete();

            return { contours, hier };
        }

        function get_largest_contour(contours, borderRatio) {
            let maxAreaCnt = null;
            let maxArea = 0;

            for (let i = 0; i < contours.size(); i++) {
                // Get bounding rectangle of contour
                let cnt = contours.get(i);
                let cntObj = cv.boundingRect(cnt);

                let area = cntObj.width * cntObj.height;
                let ratio = cntObj.height / cntObj.width;

                let diff = Math.abs(ratio - borderRatio);

                if (diff >= 0 && diff <= 1) {
                    // Check if the area of the current contour is larger than the max_area
                    if (area > maxArea) {
                        maxArea = area;
                        maxAreaCnt = cntObj;
                    }
                }
            }

            return maxAreaCnt;
        }

        function get_region_of_interest(cnt, offsetHt, ori_img) {
            // Get contour bounding box coordinates
            let minX = cnt.x;
            let minY = cnt.y;
            let cntWt = cnt.width;
            let cntHt = cnt.height;

            // Calculate max_x and max_y coordinates
            let maxX = minX + cntWt;
            let maxY = minY + cntHt;

            // Adjust y-coordinates by offset
            minY += offsetHt;
            maxY += offsetHt;

            // Crop Region Of Interest (ROI)
            const roi_region = new cv.Rect(minX, minY, maxX - minX, maxY - minY);
            const roi_img = ori_img.roi(roi_region);

            return roi_img;
        }

        function wm_calculate_width_height(roiWt, roiHt, oriWt, oriHt) {
            // Calculate Width And Height Based on Ratio
            let mulWt = oriWt / roiWt;
            let mulHt = oriHt / roiHt;

            // Calculate the resulting width and height
            let resWt = mulWt * BORDER_WT;
            let resHt = mulHt * BORDER_HT;

            // Create log object
            let logObj = {
                "Mul_Width": mulWt,
                "Mul_Height": mulHt,
                "Border_Width": BORDER_WT,
                "Border_Height": BORDER_HT,
                "Result_Width": resWt,
                "Result_Height": resHt
            };

            // if (mulWt > 50 && mulHt > 50) {
            //     throw new Error('Image is too large');
            // }

            // if (mulWt < 5 && mulHt < 5) {
            //     throw new Error('Image is too Small');
            // }

            return [resWt, resHt, logObj];
        }
    </script>
    <script type="text/javascript">
        function eucli_dist(pt_a, pt_b) {
            const [pt_ax, pt_ay] = pt_a;
            const [pt_bx, pt_by] = pt_b;
            //return Math.sqrt(Math.pow(pt_ax - pt_bx, 2) + Math.pow(pt_ay - pt_by, 2));
            return Math.hypot(pt_ax - pt_bx, pt_ay - pt_by);
        }

        function wp_calculate_width_height(pt_top_left, pt_top_right, pt_bottom_left, pt_bottom_right) {
            // Calculate width using Euclidean distance between top points and bottom points
            const width_top = eucli_dist(pt_top_left, pt_top_right);
            const width_bottom = eucli_dist(pt_bottom_left, pt_bottom_right);
            const width = Math.max(Math.floor(width_top), Math.floor(width_bottom));

            // Calculate height using Euclidean distance between left points and right points
            const height_left = eucli_dist(pt_top_left, pt_bottom_left);
            const height_right = eucli_dist(pt_top_right, pt_bottom_right);
            const height = Math.max(Math.floor(height_left), Math.floor(height_right));

            return [width, height];
        }

        function warp_perspective(ori_img, pt_top_left, pt_top_right, pt_bottom_left, pt_bottom_right) {
            // Calculate width and height
            const [width, height] = wp_calculate_width_height(pt_top_left, pt_top_right, pt_bottom_left, pt_bottom_right);

            // Create point matrix
            const pt_matrix = cv.matFromArray(4, 1, cv.CV_32FC2, [
                ...pt_top_left,
                ...pt_top_right,
                ...pt_bottom_left,
                ...pt_bottom_right,
            ]);

            // Desired points value in output images
            const pt_top_left_value = [0, 0];
            const pt_top_right_value = [width - 1, 0];
            const pt_bottom_left_value = [0, height - 1];
            const pt_bottom_right_value = [width - 1, height - 1];

            // Convert points
            const converted_pts = cv.matFromArray(4, 1, cv.CV_32FC2, [
                ...pt_top_left_value,
                ...pt_top_right_value,
                ...pt_bottom_left_value,
                ...pt_bottom_right_value
            ]);

            // Perspective transform
            const perspective_transform = cv.getPerspectiveTransform(pt_matrix, converted_pts);
            const dst = new cv.Mat();
            const mat_size = new cv.Size(width, height);
            cv.warpPerspective(ori_img, dst, perspective_transform, mat_size);

            return dst;
        }

        function drawCircle(img, pt, color) {
            const point = new cv.Point(pt[0], pt[1]);

            // Draw a circle on the image
            const radius = 10;
            cv.circle(img, point, radius, color, cv.FILLED);
        }

        function updatePointHelper(points, wscf, hscf) {
            const [x, y] = points;
            return [x * wscf, y * hscf];
        }

        function updatePoints(points, oWt, oHt, nWt, nHt) {
            // Calculate scaling factors
            const wscf = nWt / oWt;
            const hscf = nHt / oHt;

            let { top_left, top_right, bottom_left, bottom_right } = points;

            top_left = updatePointHelper(top_left, wscf, hscf);
            top_right = updatePointHelper(top_right, wscf, hscf);
            bottom_left = updatePointHelper(bottom_left, wscf, hscf);
            bottom_right = updatePointHelper(bottom_right, wscf, hscf);

            // Update each point
            const updatedPoints = { top_left, top_right, bottom_left, bottom_right };
            return updatedPoints;
        }

        function getBase64(canva_img) {
            return canva_img.toDataURL().split(';base64,')[1];
        }
